import React, { useEffect, useState } from 'react'
import Data from './Data';
import { Link } from 'react-router-dom';
import axios from 'axios';

function Profile() {

  useEffect(()=>{




  })

  const [crop,setCrop]=useState("")
  const [area,setArea] = useState(0);
  const [state,setState]=useState("")
  const[district,setDistrict]=useState("")
  const [taluka,setTaluka]=useState("")

console.log(crop);
console.log(area)
console.log(state)
console.log(district)
console.log(taluka)

let data

  function handleSubmit(e){

     e.preventDefault();

    data={
      
         crop:crop,
         area:area,
         state:state,
         district:district,
         taluka:taluka
     }
     console.log(data)

     let response = axios.post("http://localhost:4500/cropdata/",data)
    
    
  
  }

 

  return (
    <div className='profile-main'>
    <div className='profile'>
      
        <div>

        </div>
    
    <div className='add-crop'>
       <h1>Add Crop</h1>
       <form onSubmit={handleSubmit}>
       <select onChange={(e)=>{setCrop(e.target.value)}}>
            <option >select</option>
            <option value='onion'  >onion</option>
            <option value='graps'  >graps</option>
            <option value='mango' >mango</option>
            <option value='banna'  >banna</option>
            <option value='orange'>orange</option>
         </select>
         <br></br>
         <input type='text' placeholder='Enter crop area acers'  onChange={(e)=>{setArea(e.target.value)}}/>
         <br></br>
         <input type='text' placeholder='Enter State'  onChange={(e)=>{setState(e.target.value)}}/>
         <br></br>
         <input type='text' placeholder='Enter District'  onChange={(e)=>{setDistrict(e.target.value)}}/>
         <br></br>
         <input type='text' placeholder='Enter Taluka'  onChange={(e)=>{setTaluka(e.target.value)}}/>
         <br></br>
           
           <button onClick={handleSubmit} >Submit</button>
    
       </form>
      


    
    </div>

    {/* <Data 
      
farea={area}
croptype={cropname}
cropPhoto={imgcrop}
billPhoto={bill}
    ></Data>
    */}

    </div>
    </div>
  )
}

export default Profile;
